Boxoft Photo Cool Maker 3.7.0


Boxoft Photo Cool Maker is easy-to-use photo decorate software, it provides you various decorate effects for you to beautify your pictures within a few clicks. You can easily blend your digital photo onto other pictures, add professional effects to your photos with Framing and edging effects, embed flowers, cartoon pictures onto your photos, etc.

Features:

Edit images with adding stunning effects;
Provide nice backgrounds or you can choose from computer;
Directly get images form PC or Digital Camera;
Enable blend image onto another image;
Preview image effect while processing;
Provide multiple kinds of Mask;
Provide 100+ types clipart decorates;
Enable add light effect on images, sunlight, starlight, chain lighting, etc;
Allow adding text within speaking frames;
Provide outline for images;
Enable edge images with diff frames;
Support delete layer, undo, redo your operations;
Allow save images in different formats: JPG, PNG, TIFF, BMP;
Enable print out edited images directly.

Home page - http://boxoft.com/photo-cool-maker/
